import React, { useState, useEffect } from 'react';
import './Header.css';
import TopHeader from './TopHeader/TopHeader';
import MiddleHeader from './MiddleHeader/MiddleHeader';
import BottomHeader from './BottomHeader/BottomHeader';

const Header = () => {
  const [isMobile, setIsMobile] = useState(window.innerWidth <= 768);
  const [mobileMenuOpen, setMobileMenuOpen] = useState(false);

  useEffect(() => {
    const handleResize = () => {
      setIsMobile(window.innerWidth <= 768);
    };

    window.addEventListener('resize', handleResize);
    return () => {
      window.removeEventListener('resize', handleResize);
    };
  }, []);

  const toggleMobileMenu = () => {
    setMobileMenuOpen(!mobileMenuOpen);
  };

  return (
    <header className="site-header">
      <TopHeader />

      {isMobile ? (
        <div className="mobile-header">
          <div className="mobile-header-top">
            <button className="hamburger-menu" onClick={toggleMobileMenu}>
              <img src="/icons/hamburger-menu.svg" alt="Menu" />
            </button>

            <div className="logo-container">
              <h1 className="site-logo">HF</h1>
            </div>

            <div className="mobile-actions">
              <a href="#search" className="search-link">
                <img src="/icons/search-icon.svg" alt="Search" className="action-icon" />
              </a>
              <a href="#cart" className="cart-link">
                <img src="/icons/cart-icon.svg" alt="Cart" className="action-icon" />
                <span className="cart-count">1</span>
              </a>
            </div>
          </div>

          {mobileMenuOpen && (
            <div className="mobile-menu">
              <div className="mobile-nav">
                <ul className="mobile-nav-menu">
                  <li><a href="#prom">PROM</a></li>
                  <li><a href="#hoco">HOCO</a></li>
                  <li><a href="#wedding">WEDDING</a></li>
                  <li><a href="#wedding-guest">WEDDING GUEST</a></li>
                  <li><a href="#bridesmaid">BRIDESMAID</a></li>
                  <li><a href="#mother-of-bride">MOTHER OF BRIDE</a></li>
                  <li><a href="#quince">QUINCE</a></li>
                  <li><a href="#formal">FORMAL</a></li>
                  <li><a href="#others">OTHERS</a></li>
                </ul>
              </div>

              <div className="mobile-user-actions">
                <a href="#account" className="account-link">
                  <img src="/icons/profile-icon.svg" alt="Profile" className="action-icon" />
                  <span>My Account</span>
                </a>
                <a href="#wishlist" className="wishlist-link">
                  <img src="/icons/heart-icon.svg" alt="Wishlist" className="action-icon" />
                  <span>Wishlist</span>
                </a>
                <a href="#currency" className="currency-link">
                  <img src="/images/us-flag.png" alt="US Flag" className="flag-icon" />
                  <span>USD</span>
                </a>
              </div>
            </div>
          )}
        </div>
      ) : (
        <>
          <MiddleHeader />
          <BottomHeader />
        </>
      )}
    </header>
  );
};

export default Header;
